import React from 'react'
import axios from '../../config/axios'
import { Link } from 'react-router-dom'

class List extends React.Component{
    constructor(){
        super()
        this.state = {
            contacts : []
        }
    }

    componentDidMount(){
        axios.get('/contacts')
            .then(response => {
                const contacts = response.data
                this.setState({contacts})
                console.log('contact',contacts)
            })
            .catch(err => {
                console.log(err)
            })
    }

    render(){
        return(
            <div>
                <h3>Contact List:-{this.state.contacts.length}</h3>
                    <ul>
                        {
                            this.state.contacts.map(contact => {
                                return <li key={contact._id}>{contact.firstName} { contact.lastName} <Link to={`/contacts/${contact._id}`}>Info</Link> </li>
                            })
                        }
                    </ul>
            </div>
        )
    }
}

export default List
